How to post request for a particular field of array in mern stack<p>The code does not add answer in answers array......pls explain how to write the correct way to implement it?
The 'id' is of the question, used for params.</p>
<p>Schema:</p>
<pre><code>const QuestionSchema = new mongoose.Schema({
    qtitle:{
        type:String,
        required:true
    },
    descofq:{
        type:String,
        required:true
    },
    pic:{
        type:String,
        default:&quot;no photo&quot;
    },
    answers:[
        {
            answer:{
                type:String,
                required:false
            },
            picofa:{
                type:String,
                default:&quot;no photo&quot;
            },
            postedBy:{
                type:mongoose.Schema.Types.ObjectId,
                ref:&quot;USER&quot;
            }
        }
    ]
    }
})
</code></pre>
<p>POST request :</p>
<pre><code>router.post('/answer/:id',authenticate,(req,res)=&gt;{
    Question.findById(req.params.id).then(question=&gt;{
        question.answers.answer = req.body.answer;
        question.save().then(result=&gt;{
            res.json(result)
        }).catch(err=&gt;{
            res.status(400).send(err);
        })
    }).catch(err=&gt;{
        res.status(200).send(err);
    })
})
</code></pre>
<p>I also tried question.answers.answer.push(answer);
where the answer in brackets will be acquired from req.body, but this also didn't work.</p>

