How to convert array of objects into nested object in MongoDB aggregation pipeline<p>I am currently doing a project where my Database Management System is MongoDB. I am writing an aggregation pipeline where there are several stages. I am currently struggling at a particular stage where I want to obtain the following output. MongoDB has so many operator expressions that I am confused about which one to use to achieve this.
I have a collection called Styles and Skus which are as follows:</p>
<pre><code>// Schema for styles
const styles = mongoose.Schema({
  id: Number,
  productId: Number,
  name: String,
  sale_price: String,
  original_price: String,
  default_price: Boolean,
}, {
  strict: false,
});

// Schema for skus
const skus = mongoose.Schema({
  id: Number,
  styleId: Number,
  size: String,
  quantity: String,
}, {
  strict: false,
});
</code></pre>
<p>Each style can have several SKUs, one-to-many relationships. In my aggregation pipeline, I am using $lookup to find all the SKUs of that particular style and adding a new field called SKUs in the styles document. I am getting results like this after the $lookup.</p>
<pre><code>{
            &quot;style_id&quot;: 1,
            &quot;name&quot;: &quot;Forest Green &amp; Black&quot;,
            &quot;original_price&quot;: &quot;140&quot;,
            &quot;sale_price&quot;: &quot;0&quot;,
            &quot;default?&quot;: true,
             &quot;skus&quot;: [
                { 
                   &quot;id&quot;: 37,
                   &quot;styleId&quot;: 1,
                   &quot;size&quot;: &quot;XS&quot;,
                   &quot;quantity&quot;: 16 
                },
                { 
                   &quot;id&quot;: 38,
                   &quot;styleId&quot;: 1,
                   &quot;size&quot;: &quot;S&quot;,
                   &quot;quantity&quot;: 8
                } 
              ]  

}
</code></pre>
<p>Which is expected as $lookup returns a matching array. But I want my Styles document to look like this.</p>
<pre><code>{
            &quot;style_id&quot;: 1,
            &quot;name&quot;: &quot;Forest Green &amp; Black&quot;,
            &quot;original_price&quot;: &quot;140&quot;,
            &quot;sale_price&quot;: &quot;0&quot;,
            &quot;default?&quot;: true,
             &quot;skus&quot;: {
                  &quot;37&quot;: {
                    &quot;styleId&quot;: 1,
                   &quot;size&quot;: &quot;XS&quot;,
                   &quot;quantity&quot;: 16 
                  },
                  &quot;38&quot;: {
                   &quot;styleId&quot;: 1,
                   &quot;size&quot;: &quot;S&quot;,
                   &quot;quantity&quot;: 8
                  }
               }


}
</code></pre>
<p>Can someone give any idea how to structure the data like above in aggregation pipeline? Any help would be greatly appreciated. Thanks in advance.</p>

