Get min value from array of object using aggregate and lookup mongodb<p>I have two collections <code>properties</code> and <code>property_prices</code> and the relation is one property many prices. So I am trying to join them and then find min value from <code>property_prices.monthly_unit_price.unit_price</code>. So I could get the Properties with their prices and min unit_price value from entire property pricing.</p>
<p><code>Property Collection</code></p>
<pre><code>{
    &quot;_id&quot;: &quot;1&quot;,
    &quot;status&quot;: &quot;Approved&quot;,
    &quot;name&quot;: &quot;My Property Lake&quot;
}
</code></pre>
<p><code>Property Price Collection</code> where monthly_unit_price have objects from Jan - Dec</p>
<pre><code>{
    &quot;property_prices&quot;: [
        {
            &quot;property_id&quot;: &quot;1&quot;,
            &quot;block_id&quot;: &quot;ABC&quot;,
            &quot;monthly_unit_price&quot;: [{ &quot;month&quot;: &quot;Jan&quot;, &quot;unit_price&quot;: 100 }, { &quot;month&quot;: &quot;Dec&quot;, &quot;unit_price&quot;: &quot;1200&quot; }],
        },
        {
            &quot;property_id&quot;: &quot;1&quot;,
            &quot;block_id&quot;: &quot;DEF&quot;,
            &quot;monthly_unit_price&quot;: [{ &quot;month&quot;: &quot;Jan&quot;, &quot;unit_price&quot;: &quot;200&quot; }, { &quot;month&quot;: &quot;Dec&quot;, &quot;unit_price&quot;: &quot;2400&quot; }],
        }
    ]
}
</code></pre>
<p>Basically I want to get the min value from property_prices <code>unit_price</code> for <code>property_id</code> 1</p>
<p>So I tried using <code>aggregate</code> and <code>lookup</code> but I cant get the min value for entire property from <code>property_prices</code>.
Here is what I tried</p>
<pre><code>await Property.aggregate([
    {
        $lookup: {
          from: 'property_prices',
          as: 'property_prices',
          let: { property_id: '$_id' },
          pipeline: [
            {
                $match: {
                    $expr: {
                    $and: [
                        { $eq: ['$property_id', '$$property_id'] },
                        { $eq: ['$status', 'Completed'] },
                    ]
                    }
                }
            },

          ]
        },
    },
    {
        $unwind: &quot;$property_prices&quot;
    },
    {
        $group: {
            _id: '$property_prices.property_id',
            minInvestment: { &quot;$min&quot;: &quot;$property_prices.monthly_unit_price.unit_price&quot; }
        }
    },
]);
</code></pre>
<p>Result I am expecting is</p>
<pre><code>{
    &quot;_id&quot;: &quot;1&quot;,
    &quot;status&quot;: &quot;Approved&quot;,
    &quot;name&quot;: &quot;My Property Lake&quot;,
    &quot;property_prices&quot;: [
        {
            &quot;property_id&quot;: &quot;1&quot;,
            &quot;block_id&quot;: &quot;ABC&quot;,
            &quot;monthly_unit_price&quot;: [{ &quot;month&quot;: &quot;Jan&quot;, &quot;unit_price&quot;: 100 }, { &quot;month&quot;: &quot;Dec&quot;, &quot;unit_price&quot;: &quot;1200&quot; }],
        },
        {
            &quot;property_id&quot;: &quot;1&quot;,
            &quot;block_id&quot;: &quot;DEF&quot;,
            &quot;monthly_unit_price&quot;: [{ &quot;month&quot;: &quot;Jan&quot;, &quot;unit_price&quot;: &quot;200&quot; }, { &quot;month&quot;: &quot;Dec&quot;, &quot;unit_price&quot;: &quot;2400&quot; }],
        }
    ],
    &quot;minInvestment&quot;:100
}
</code></pre>

