Look up MongoDB for documents matching an array of partial phone numbers<p>As part of some 'people you may know' function, we have an app that sends an array of the last 9 digits of the users contacts (last 9 digits as there are issues with the way users may store contact details like using a country code etc). The API must then perform a lookup where we need to find any user documents in our database where the last 9 digits of any users phone number matches a phone number in the array.</p>
<p>I was hoping to do something like:</p>
<pre><code>
usersContacts = [123456789, 987654321, 123443212,...]

find: {
  phoneNumber: {
     $in: usersContacts,
     $regex: 'Some last 9 digit match regex'
  }
}

</code></pre>
<p>The following does work in an aggregation pipeline:</p>
<pre><code>$match: {
  phoneNumStr: {
     $in: [/861650975$/, /861650976$/]
  }
}
</code></pre>
<p>Two issues with the above are that I needed project the phone number field to a string first (which is fine) but also would need to add N number of different regex statements by looping over the array sent by the app and creating /{phoneNum}$/</p>
<p>Are there any performance issues with this? Or is this okay?</p>

